import React, { Component } from "react";
import { Header, Table } from "semantic-ui-react";

class MyTable extends Component {
  constructor(props) {
    super(props);
    this.state = {
      tableData: []
    };
  }
  componentWillReceiveProps(nextProps) {
    this.setState({
      tableData: nextProps.tableData
    });
  }
  render() {
    let tableData = this.state.tableData;
    return (
      <div>
        <Table striped color="blue">
          <Table.Body>
            <Table.Row textAlign="center">
              <Table.Cell>
                <Header>S.No.</Header>
              </Table.Cell>
              <Table.Cell>
                <Header>IssueID</Header>
              </Table.Cell>
              <Table.Cell>
                <Header> Issue Title</Header>
              </Table.Cell>
              <Table.Cell>
                <Header> Created</Header>
              </Table.Cell>
              <Table.Cell>
                <Header> Last Updated</Header>
              </Table.Cell>
            </Table.Row>

            {tableData && Object.keys(tableData).length > 0 ? (
              tableData.map((data, index) => (
                <Table.Row textAlign="center">
                  <Table.Cell>{index + 1}</Table.Cell>
                  <Table.Cell>{data.number}</Table.Cell>
                  <Table.Cell>{data.title}</Table.Cell>
                  <Table.Cell>{data.created_at}</Table.Cell>
                  <Table.Cell>{data.updated_at}</Table.Cell>
                </Table.Row>
              ))
            ) : (
              <Table.Cell textAlign="center" colSpan="10">
                No Record Found
              </Table.Cell>
            )}
          </Table.Body>
        </Table>
      </div>
    );
  }
}

export default MyTable;
